import React from "react";
import './App.css';

import Card from "./Components/Card/Card.js";

function App() {
return (
    <div className="container">
        <Card type="box" size="small">
            <p className="text--body">This could become a notification bar</p>
        </Card>
        <Card type="box" size="medium" spacing="large">
            <h3 className="text--heading">Widget Heading</h3>
            <p className="text--body">This could be a basic card which holds some text and a button. The text could end up being pretty long which would result it in being wrapped based on the width of the card.</p>
            <p className="text--body">In some cases there might be multiple paragraphs.</p>
        </Card>
    </div>
);
}

export default App;
